  place-content: center;
  display: block;
  flex-shrink: 0;
  width: 100%;
  height: 400px;
  margin-right: 0px;
  box-sizing: border-box;
  background: grey;
  transform-origin: center center;
  transform: scale(1);
  scroll-snap-align: center;
}
